import React, { useEffect } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import "./index.css";
import FacebookIcon from "@material-ui/icons/Facebook";
import Aos from "aos";
import "aos/dist/aos.css";
import InstagramIcon from "@material-ui/icons/Instagram";
import EmailIcon from "@material-ui/icons/Email";
import Button from "@material-ui/core/Button";

const Footer = () => {
  useEffect(() => {
    Aos.init({ duration: 1000, easing: "ease-in-sine" });
  }, []);
  return (
    <>
      <footer className="myfooter">
        <div className="container mt-4  mt-md-1 " data-Aos="zoom-in">
          <div className="row">
            <div className="col-12 d-flex justify-content-center align-items-center flex-column">
              <h2
                className="text-center text-danger"
                style={{ fontFamily: "caveeat" }}
              >
                Get in Touch With Me
              </h2>
              <div className="content">
                <p className="text-center " style={{ fontFamily: "caveeat" }}>
                  <strong>
                    Graphic design is one of the most demanding service in
                    today's market businesses run over advertisements which we
                    deliver to your business with great proficiency.
                  </strong>
                </p>
              </div>
            </div>

            <div className="col-12 d-flex justify-content-center align-items-center">
              <div
                className="btn-group d-flex justify-content-around"
                role="group"
                aria-label="Basic example"
              >
                <Button>
                  <FacebookIcon style={{ color: "#3b5998" }} />
                  Facebook
                </Button>

                <Button href="https://www.facebook.com">
                  <InstagramIcon style={{ color: "red" }} />
                  Instagram
                </Button>
                <Button>
                  <EmailIcon style={{ color: "black" }} />
                  email
                </Button>
              </div>
            </div>
          </div>
        </div>
      </footer>
    </>
  );
};
export default Footer;
